import React from 'react';
import "./index.css"
import { Route, Switch } from "react-router-dom";
import Secondpage from "./Secondpage"


const Mainpage = () => {

const bgChange = () =>{
    <Route exact path='/secondpage' component={Secondpage}/>
}

    return (
        <>

            <div style={{ backgroundColor: 'royalblue', width: '100vw', height: '100vh' }} class='bg-center text-center full-width cover-full my-0 mt-0'>
                <div class="card-body">
                    <h1 class="text-center cover-full">Home Network Solutions</h1>

                </div>
                <img  onClick = {bgChange} src="/images/Home.png" alt="" />
            </div>

        </>

    );
}


export default Mainpage;
